import './App.scss';
import React from "react";
import Header from "./Components/Header/Header";
import {BrowserRouter} from "react-router-dom";
import {Route, Switch, useHistory} from "react-router";
import Patient from "./Components/Main Content/Patient/Patient";
import PatientInformationWrapper from "./Components/Main Content/Patient/Patient Information/PatientInformationWrapper";
import {
    clinicsURLs as clinicsURL,
    employeeURLS,
    invoicesURL,
    patientURLS,
    waitingQueueURLs
} from "./Constants/URLConstants";
import Employee from "./Components/Main Content/Employee/Employee";
import InvoiceInfo from "./Components/Main Content/Invoices/InvoiceInfo";
import Clinic from "./Components/Main Content/Clinics Components/Clinic";
import EmployeeInformationWrapper from "./Components/Main Content/Employee/Employee Information/EmployeeInformation";
import WaitingQueueMain from "./Components/Main Content/Waiting Queue/WaitingQueueMain";
import WaitingQueueList from "./Components/Main Content/Waiting Queue/WaitingQueueList";
import InvoiceForm from "./Components/Main Content/Invoices/InvoiceForm";

function App() {
    const history = useHistory();

    return (
        <div className="application">
            <BrowserRouter history={history}> >
                <Header/>
                <main className="main-content">
                    <Switch>

                        {/*patient routes*/}
                        <Route exact path={patientURLS.patient} component={Patient}/>
                        <Route exact path={`${patientURLS.patientInfo}:id`} component={PatientInformationWrapper}/>

                        {/*employee routes*/}
                        <Route exact path={employeeURLS.employee} component={Employee}/>
                        <Route exact path={`${employeeURLS.employeeInfo}:id`} component={EmployeeInformationWrapper}/>

                        {/*invoice routers*/}
                        <Route exact path={invoicesURL.getInvoice + `/:id`} component={InvoiceInfo}/>
                        <Route exact path={invoicesURL.invoiceForm + `/:id`} component={InvoiceForm}/>


                        {/*waiting queue routers*/}
                        <Route exact path={waitingQueueURLs.waitingQueueForm} component={WaitingQueueMain}/>
                        <Route exact path={waitingQueueURLs.waitingQueueList} component={WaitingQueueList}/>

                        {/*clinics routers*/}
                        <Route exact path={clinicsURL.clinics + `/:id`} component={Clinic}/>
                        <Route exact path={clinicsURL.clinics} component={Clinic}/>

                    </Switch>
                </main>

            </BrowserRouter>

        </div>
    );
}

export default App;
